import React, { Component } from "react";
import { NavLink } from "react-router-dom"

export default class Navbar extends Component {
  render() {
    return (
      <div className="navbarHeader">
          <div className="logo">
              <img src="" />
          </div>
          <div className="navbarCenter">
              <a href="filmblock" ng-click="sendGA('Home', 'Header', 'Calendar')" class="menu titleDisplay homeMovies white" data-scroll="homeMovies">Lịch Chiếu</a>

          </div>
      </div>
    );
  }
}
